import React from "react";
import ReactDOM from "react-dom";

const name = "Afnan";
const img1 = "https://images.pexels.com/photos/14030389/pexels-photo-14030389.jpeg?auto=compress&cs=tinysrgb&w=300&lazy=load";
const img2 = "https://images.pexels.com/photos/13067890/pexels-photo-13067890.jpeg?auto=compress&cs=tinysrgb&w=300&lazy=load";
const img3 ="https://images.pexels.com/photos/10610441/pexels-photo-10610441.jpeg?auto=compress&cs=tinysrgb&w=300&lazy=load";

ReactDOM.render(
    <>
        <h1 contentEditable="true"> Hello, My Name is {name}</h1>
        <img src={img1} />
        <img src={img2} />
        <img src={img3} />
    </>,
    document.getElementById("root")
);
